description:
Have you ever played a game where a naked man kills you with a rock? If not, then you haven't played Rust.
The only aim in Rust is to survive. To do this you will need to overcome struggles such as hunger, thirst and cold.  Build a shelter.  Kill animals for meat. Protect yourself from other players. Create alliances with other players and together form a town, or attack one...

