Installation:
1. Unpack anywhere
2. Change your name in LumaEmu.ini
3. Launch the game with &quot;Rust Launcher.exe&quot;
4. Press F1 and enter &quot;net.connect ServerIP:Port&quot;
5. Enjoy!

If you like it, buy it, support the development.

**No new server files needed, this client will run on the v1069 server files**
